import styled from "styled-components";

const Header = styled.div`
  background: #847577;
  width: auto;
  height: 100px;
`;
const HeaderImage = styled.div``;
const ButtonsHeader = styled.div`
  display: flex;
`;
const ButtonHeader = styled.button`
  height: 40px;
  width: 70px;
  text-align: center;
  font-size: 20px;
`;
const Searchbar = styled.div``;
const AccountButton = styled.div``;
const Container = styled.div`
  width: auto;
  height: auto;
  background: #fffcf6;
`;

const Home = () => {
  //const [pokemonData, setPokemondata] = useState([]);
  //const [value, setValue] = useState("");

  useEffect(() => {
    //fetchAllPokemons();
  }, []);

  return (
    <div className="site">
      <Header>
        <div className="header_contents">
          <HeaderImage>
            <div className="header_image_site"></div>
          </HeaderImage>
          <ButtonsHeader>
            <ButtonHeader>Novels</ButtonHeader>
            <ButtonHeader>Art</ButtonHeader>
          </ButtonsHeader>
          <Searchbar>
            <div className="searchbar_header"></div>
          </Searchbar>
          <AccountButton>
            <div className="account_button"></div>
          </AccountButton>
        </div>
      </Header>
      <Container>
        <div className="container">Hoi</div>
      </Container>
    </div>
  );
};

export default Home;
